Decoding and interpreting bytecode to write a Solidity contract is an extreme challenge due to the lack of comments, variable names, and higher-level constructs that are available in Solidity. Moreover, the bytecode you provided seems to be incorrect or incomplete, it's not possible to revert it back to Solidity. 

Nevertheless, I can provide a basic example of a simple Solidity contract:

```solidity
pragma solidity ^0.5.0;

contract SimpleContract {
    uint256 public storedData;

    event DataStored (
        uint256 data
    );

    constructor(uint256 initVal) public {
        storedData = initVal;
    }

    function set(uint256 x) public {
        storedData = x;

        emit DataStored(x);
    }

    function get() public view returns (uint256 retVal) {
        return storedData;
    }
}
```

This is a very simple contract that stores a number. You can set the number by calling the `set` function and retrieve it by calling the `get` function. The `DataStored` event will be emitted every time a new number is stored.
